import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import '../styles/MainBanner.css';
import dog1 from '../images/dogs/dog1.jpg';
import cat1 from '../images/cats/cat1.jpg';
import parrot1 from '../images/birds/parrot1.jpg';
import greenarowana1 from '../images/fishes/greenarowana1.jpeg';
import pet_accessories from '../images/accessories/pet_accessories.jpg';
import petfood from '../images/petfoods/petfood.png';

const MainBanner = () => {
  return (
    <Container fluid>
      <Row className="no-gutters">
        <Col md={4} sm={6}>
          <img src={cat1} alt="Cat 1" className="banner-image" />
        </Col>
        <Col md={4} sm={6}>
          <img src={dog1} alt="Dog 1" className="banner-image" />
        </Col>
        <Col md={4} sm={6}>
          <img src={parrot1} alt="Parrot 1" className="banner-image" />
        </Col>
        <Col md={4} sm={6}>
          <img src={greenarowana1} alt="Fish 1" className="banner-image" />
        </Col>
        <Col md={4} sm={6}>
          <img src={pet_accessories} alt="Accessories" className="banner-image" />
        </Col>
        <Col md={4} sm={6}>
          <img src={petfood} alt="Pet Food" className="banner-image" />
        </Col>
      </Row>
      <hr /> {/* Add an <hr> element for the horizontal line */}
    </Container>
  );
};

export default MainBanner;
